import React from 'react';

import Grid from '@material-ui/core/Grid';

import { 
    HeaderProfileContainer,
    GridContainer,
    TitleContainer,
    SubtitleContainer,
    SearchIconContainer,
    MenuIconContainer,
    BronzeFlag
  } from './calculator-styles';

import bronzeflag from "assets/bronze_flag.svg";


const Calculator = () => {
  return (
    <HeaderProfileContainer>
      <SearchIconContainer />
      <MenuIconContainer  />
      <GridContainer>
        <Grid container spacing={2}
          direction="row"
          justify="center"
          alignItems="center">
          <Grid item xs={6}>
            <BronzeFlag src={ bronzeflag } />
          </Grid>
        </Grid>
      </GridContainer>

    </HeaderProfileContainer>
  );
}

export default Calculator;
